import React from 'react'
import './portfolio.css'

const CollectPayouts = () => {
    return(
        <div className="CollectPayouts">
            <div>Collect Pending Win Payouts</div>
            <div>Number of Pending WP: 5</div>
        </div>
    )
}

export default CollectPayouts
